USE DatingApp;
GO

-- Insert 100 accounts with the first account as an Administrator
INSERT INTO Accounts (DisplayName, BirthDate, UserName, Email, Password, CreateDate, Role)
SELECT 
    CASE WHEN Numbers.RowNum = 1 THEN 'AdminUser' ELSE CONCAT('User', Numbers.RowNum) END,
    DATEADD(YEAR, -25, GETDATE()), -- BirthDate 25 years ago
    CASE WHEN Numbers.RowNum = 1 THEN 'admin' ELSE CONCAT('username', Numbers.RowNum) END,
    CASE WHEN Numbers.RowNum = 1 THEN 'admin@mail.com' ELSE CONCAT('user', Numbers.RowNum, '@mail.com') END,
    'Passw0rd', -- Default password
    GETDATE(), -- CreateDate
    CASE WHEN Numbers.RowNum = 1 THEN 'Administrator' ELSE 'User' END -- Role
FROM 
    (SELECT TOP 100 ROW_NUMBER() OVER (ORDER BY (SELECT NULL)) AS RowNum FROM sys.objects) AS Numbers;

-- Insert 50 male profiles with AccountId matching ProfileId
INSERT INTO Profiles (AccountId, DisplayName, Height, Weight, Bio, BirthDate, Gender, ZipCode, Pic)
SELECT 
    AccountId,
    CASE 
        WHEN RowNum <= 10 THEN CONCAT('MaleUserType1_', RowNum)
        WHEN RowNum <= 20 THEN CONCAT('MaleUserType2_', RowNum)
        WHEN RowNum <= 30 THEN CONCAT('MaleUserType3_', RowNum)
        WHEN RowNum <= 40 THEN CONCAT('MaleUserType4_', RowNum)
        ELSE CONCAT('MaleUserType5_', RowNum)
    END AS DisplayName,
    CASE 
        WHEN RowNum <= 10 THEN 180
        WHEN RowNum <= 20 THEN 175
        WHEN RowNum <= 30 THEN 170
        WHEN RowNum <= 40 THEN 185
        ELSE 190
    END AS Height, -- Height in cm
    CASE 
        WHEN RowNum <= 10 THEN 75
        WHEN RowNum <= 20 THEN 70
        WHEN RowNum <= 30 THEN 80
        WHEN RowNum <= 40 THEN 85
        ELSE 90
    END AS Weight, -- Weight in kg
    CASE 
        WHEN RowNum <= 10 THEN 'This is a bio for male user type 1.'
        WHEN RowNum <= 20 THEN 'This is a bio for male user type 2.'
        WHEN RowNum <= 30 THEN 'This is a bio for male user type 3.'
        WHEN RowNum <= 40 THEN 'This is a bio for male user type 4.'
        ELSE 'This is a bio for male user type 5.'
    END AS Bio,
    DATEADD(YEAR, -25, GETDATE()), -- BirthDate 25 years ago
    1,  -- Gender (1 for male)
    CASE 
        WHEN RowNum <= 10 THEN 1000
        WHEN RowNum <= 20 THEN 1800
        WHEN RowNum <= 30 THEN 3400
        WHEN RowNum <= 40 THEN 2750
        ELSE 2500
    END AS ZipCode, -- ZipCode
    ''
	-- Default Pic for male profiles
FROM 
    (SELECT AccountId, ROW_NUMBER() OVER (ORDER BY AccountId) AS RowNum FROM Accounts WHERE AccountId <= 50) AS MaleAccounts;

-- Insert 50 female profiles with AccountId matching ProfileId
INSERT INTO Profiles (AccountId, DisplayName, Height, Weight, Bio, BirthDate, Gender, ZipCode, Pic)
SELECT 
    AccountId,
    CASE 
        WHEN RowNum <= 10 THEN CONCAT('FemaleUserType1_', RowNum)
        WHEN RowNum <= 20 THEN CONCAT('FemaleUserType2_', RowNum)
        WHEN RowNum <= 30 THEN CONCAT('FemaleUserType3_', RowNum)
        WHEN RowNum <= 40 THEN CONCAT('FemaleUserType4_', RowNum)
        ELSE CONCAT('FemaleUserType5_', RowNum)
    END AS DisplayName,
    CASE 
        WHEN RowNum <= 10 THEN 165
        WHEN RowNum <= 20 THEN 160
        WHEN RowNum <= 30 THEN 155
        WHEN RowNum <= 40 THEN 170
        ELSE 175
    END AS Height, -- Height in cm
    CASE 
        WHEN RowNum <= 10 THEN 60
        WHEN RowNum <= 20 THEN 55
        WHEN RowNum <= 30 THEN 65
        WHEN RowNum <= 40 THEN 70
        ELSE 75
    END AS Weight, -- Weight in kg
    CASE 
        WHEN RowNum <= 10 THEN 'This is a bio for female user type 1.'
        WHEN RowNum <= 20 THEN 'This is a bio for female user type 2.'
        WHEN RowNum <= 30 THEN 'This is a bio for female user type 3.'
        WHEN RowNum <= 40 THEN 'This is a bio for female user type 4.'
        ELSE 'This is a bio for female user type 5.'
    END AS Bio,
    DATEADD(YEAR, -25, GETDATE()), -- BirthDate 25 years ago
    0,  -- Gender (0 for female)
    CASE 
        WHEN RowNum <= 10 THEN 2500
        WHEN RowNum <= 20 THEN 2610
        WHEN RowNum <= 30 THEN 2680
        WHEN RowNum <= 40 THEN 2720
        ELSE 1800
    END AS ZipCode, -- ZipCode
    ''
	-- Default Pic for female profiles
FROM 
    (SELECT AccountId, ROW_NUMBER() OVER (ORDER BY AccountId) AS RowNum FROM Accounts WHERE AccountId > 50) AS FemaleAccounts;
